  false,\n\t\"url\": null,\n\t\"notes\": \"Preliminary physical, nutrients, biological,
  meteorological, and other data from bottle casts, CTD casts, ADCP casts, and meteorological
  sensors from the GYRE from 04 November 1992 to 05 August 1994. Data were collected
  by Texas A&M University (TAMU) as part of the Texas-Louisiana Shelf Circulation
  and Transport Processes Study (LATEX PART A). Bottle parameters include concentrations
  of phosphate, nitrate, nitrite, urea, silicate, ammonium, chlorophyll-a, and suspended
  particulate matter. CTD parameters include temperature, oxygen, transmivitivity,
  irradiance, beam attenuation, and sigma-t. ADCP parameters include East-West components
  (U) and North-South components (V). Moored current meters parameters include East-West
  components (U), North-South components (V), temperature, and pressure. Meteorological
  data includes air temperature, sea surface temperature, wind speed, wind direction,
  and buoy direction.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
